import React from "react";
import styled from "styled-components";

const Area = styled.area`
  background-color: red;
`;
const Line8 = () => {
  return (
    <div>
      <map name="line8">
        <Area shape="circle" coords="342, 69, 40" href=""></Area>
      </map>
      <img
        src={`${process.env.PUBLIC_URL}/images/line8.jpg`}
        alt="line8"
        useMap="#line8"
      />
    </div>
  );
};

export default Line8;
